import PhotoDetial from './Container/PhotoDetail'


function PhotoList(props) {
    return (
      <div className="photo-List">
          <div>
              <li>{props.photo.name}</li>
              <img src={props.photo.image} alt={props.photo.name}/>
          </div>
      </div>

    );
  }

  export default PhotoDetial;
